  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115281 includes biological,
  chemical, discrete sample, physical and profile data collected from RYOFU MARU in
  the North Pacific Ocean, Philippine Sea and South Pacific Ocean from 2001-10-10
  to 2001-12-06 and retrieved during cruise PACIFICA_49RY20011010 and RF01-10. These
  data include ALKALINITY, AMMONIUM, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), CHLOROPHYLL A, DELTA CARBON-13, DISSOLVED INORGANIC CARBON, DISSOLVED
  ORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRATE + NITRITE
  CONTENT (CONCENTRATION), NITRITE, PHAEOPHYTIN, PHOSPHATE, Potential temperature
  (theta), SALINITY, SIGMA-THETA, SILICATE, TOTAL PHOSPHORUS, WATER TEMPERATURE and
  pH. The instruments used to collect these data include CTD and bottle. These data
  were collected by Akira Nakadate of Japan Meteorological Agency; Pollutants Chemical
  Analysis Center; Marine Division; Global Environment and Marine Depertment and Masao
  Ishii of Meteorological Research Institute; Geochemical Research Department as part
  of the PACIFICA_49RY20011010 data set.nnPACIFICA (PACIFic ocean Interior CArbon)
  was an international collaborative project for the data synthesis of ocean interior
  carbon and its related parameters in the Pacific Ocean. The North Pacific Marine
  Science Organization (PICES), Section of Carbon and Climate (S-CC) supported the
  project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
